// src/components/Navbar.js
import React from "react";
import { signOut } from "firebase/auth";
import { auth } from "../firebaseConfig";
import './Navbar.scss'; // Create a SCSS file for styling

const Navbar = ({ user, onSignOut }) => {
  return (
    <div className="navbar">
      <h1 className="navbar-title">Welcome, {user.email}</h1>
      <button onClick={onSignOut} className="signout-button">
        Sign Out
      </button>
      <div className="navbar-tabs">
        <a href="#bookings" className="navbar-tab">Book a Room</a>
        <a href="#my-bookings" className="navbar-tab">My Bookings</a>
      </div>
    </div>
  );
};

export default Navbar;
